import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './assets/components/Header';

function App() {
  return (
    <>
      <Header />
      <section id='history'>
        <Container className='justify-content-center'></Container>
      </section>
    </>
  );
}

export default App;
